    /**
     * <p>
     * Default call back handler used when writing XML files to an archive.
     * <p>
     * It runs on the result set of any provided SQL query given it has a
     * <b>UUID</b> column and a <b>COMPRESSEDCONTENT</b> column.
     * </p>
     *
     * @param zip    to write the XML files into. expected to be already
     *               initialized. This method will <b>NOT</b> close given archive
     *               upon completion.
     * @param dsMeta to know the where to put the XML inside the archive. also used
     *               in a corner cases regarding export modes.
     * @param em     to determine the correct name of the zip entry. when in doubt
     *               use <code>ExportMode.ALL</code>
     * @param cd     Used to inject a new operation to be executed while processing
     *               a record for example: for each flow property record, dump all
     *               related unit groups. default case should be a new
     *               <code>ChainDump</code> with an empty <code>apply</code>
     *               function.
     * @see ChainDump
     */

    private RowCallbackHandler datasetRowCallbackHandler(ZipArchiveBuilder zip, DataStockSQLMeta dsMeta,
                                                         ExportMode em, ChainDump cd) {
        return new RowCallbackHandler() {
            @Override
            public void processRow(ResultSet rs) throws SQLException {
                String UUID, version, fileName;
                UUID = rs.getString("UUID");
                version = rs.getString("CONCATVER");

                switch (em) {
                    case ALL:
                        fileName = UUID + "_" + version + ".xml";
                        break;

                    case LATEST_ONLY:
                        fileName = UUID + ".xml";
                        if (dsMeta != DataStockSQLMeta.Process && zip.containsEntry(dsMeta.pathInZip + fileName))
                            fileName = UUID + "_" + version + ".xml";
                        break;

                    case LATEST_ONLY_GLOBAL:
                        fileName = UUID + ".xml";
                        break;

                    default:
                        fileName = UUID + "_" + version + ".xml";
                }

                // adds file but skips already existing entries
                zip.addCompressed(rs.getBytes("COMPRESSEDCONTENT"), dsMeta.pathInZip + fileName);


                // if there is something else to do
                // while processing the current record
                cd.apply(UUID, version, zip);

//				rs.beforeFirst();
                while (rs.next()) { // Assuming rows are sorted in DESC order by version
                    UUID = rs.getString("UUID");
                    version = rs.getString("CONCATVER");

                    switch (em) {
                        case ALL:
                            fileName = UUID + "_" + version + ".xml";
                            break;

                        case LATEST_ONLY:
                            fileName = UUID + ".xml";
                            if (dsMeta != DataStockSQLMeta.Process && zip.containsEntry(dsMeta.pathInZip + fileName))
                                fileName = UUID + "_" + version + ".xml";
                            break;

                        case LATEST_ONLY_GLOBAL:
                            fileName = UUID + ".xml";
                            break;

                        default:
                            fileName = UUID + "_" + version + ".xml";
                    }

                    // adds file but skips already existing entries
                    zip.addCompressed(rs.getBytes("COMPRESSEDCONTENT"), dsMeta.pathInZip + fileName);


                    // if there is something else to do
                    // while processing the current record
                    cd.apply(UUID, version, zip);

                }
            }
        };
    }

    /**
     * Export specific dataset type from a particular datastock.
     *
     *
     * <p>
     * Executes a SQL query that join type's table with corresponding
     * <code>datastock_(type)</code> to handle root datastocks and logical
     * datastocks, then join the resulting table with <code>xmlfile</code> and get
     * compressed content.
     * </p>
     *
     * <p>
     * The method also concatenate MAJORVERSION, MINORVERSION and SUBMINORVERSION in
     * one column and then returns the result in descending order of computed
     * version
     * </p>
     *
     * @param dsMeta   Specific dataset type to export.
     * @param zip      {@link ZipArchiveBuilder#initDisk(Path, Path)
     *                 Pre-initialized} zip archive to add the external docs into.
     * @param em       {@link ExportMode} used to handle previous versions of a
     *                 dataset.
     * @param stock_id the id of the datastock which can be determined using
     *                 {@link #getDataStockID(String) getDataStockID}
     * @see DataStockSQLMeta
     * @see ZipArchiveBuilder#initDisk(Path, Path)
     * @see ExportMode
     */

    public void dumpXML(DataStockSQLMeta dsMeta, ZipArchiveBuilder zip, ExportMode em, long stock_id) {

        long t = System.currentTimeMillis();

        final String SQL = String.format(String.join(" ",
                        "SELECT DISTINCT x.ID, p.UUID, x.COMPRESSEDCONTENT,",
                        "CONCAT_WS('.', LPAD(p.MAJORVERSION, 2, '0'), LPAD(p.MINORVERSION, 2, '0'), LPAD(p.SUBMINORVERSION, 3, '0') ) AS CONCATVER",
                        "FROM %s p LEFT JOIN %s c ON p.ID = c.%s",
                        "INNER JOIN xmlfile x ON p.XMLFILE_ID = x.ID",
                        "WHERE p.root_stock_id = %d OR c.containingDataStocks_ID = %d", "ORDER BY CONCATVER DESC ;"),
                dsMeta.dsTableName, dsMeta.dsContainingTableName, dsMeta.dsIDColumnNameINContainingTable, stock_id,
                stock_id);

        // Hier geschieht die Magie
        jdbcTemplate.query(SQL, datasetRowCallbackHandler(zip, dsMeta, em, new ChainDump() {

            @Override
            public void apply(String UUID, String version, ZipArchiveBuilder zip) {
                // do nothing extra for each record
            }
        }));

        LOGGER.info(String.format("Export %s took %d ms", dsMeta.name(), System.currentTimeMillis() - t));

    }

